import './Header.css';
import { Link } from 'react-router-dom';

function Header() {
    return(
       <header className="header">
         <Link to="/" className="links">HOME</Link>
         <div className="logo">
            <img src="/images/logo.jpg" alt="site-logo" />
         </div>
         <Link to="/create" className="links">ADD RECIPE</Link>
       </header> 
    );
};

export default Header;
